import {Header} from './Header';
import './Infobox.css';

function InfoBox(){
    return(
        <div className="interfaz-infobox">
            <Header/>
            <div className="contenido">
                <h3 className="titulo">Contamos con 12 box en cada una de nuestras sedes</h3>
                <h5 className="subtitulo">4 box grandes, 4 medianos y 4 peque√±os</h5>
                <div className="box-grandes">
                    <p className="texto"> Los box grandes. Estos box estan destinados para albergar a varios pacientes en distintas actividades {'\n'}ya sea por motivos educiacionales o de reinsercion, {'\n'}de lo cual se encargan los educadores diferenciales. </p>
                </div>
                <div className="box-medianos">
                    <p className="texto"></p>
                </div>
                <div className="box-pequenos">

                </div>
            </div>
        </div>
    )
}

export default InfoBox;
